import React from "react";
import styled from 'styled-components';

const Container = styled.div`
    border: 1px solid blue;
    width: 100%;
    height: 70px;
`;

const Box = styled.div`
    border: 1px solid red;
    margin: 10px;
`;
const Category = () => {
    return(
        <Container>
            <Box>
                카테고리 담는 박스
            </Box>

        </Container>
    );
}
export default Category;
